import PropTypes from "prop-types";
import { CardContent, Typography } from "@mui/material";
import {
  MyActions,
  MyCard,
  MyTypography,
  MyButton,
  MyMedia,
} from "./PlacesCardStyles";

export default function PlacesCard({ place }) {
  return (
    <MyCard>
      <CardContent padding="5px">
        <MyMedia
          name="imagenLugar"
          component="img"
          height="240"
          image={place.strDrinkThumb}
          alt="imagen del lugar"
        />

        <Typography
          name="nombreLugar"
          margin="0px"
          gutterBottom
          variant="h6"
          component="div"
        >
          {place.strDrink} - {place.strCategory}
        </Typography>

        <Typography
          name="direccionLugar"
          gutterBottom
          variant="caption"
          component="div"
        >
          {place.strCategory}
        </Typography>

        <MyTypography
          name="descripcionLugar"
          variant="caption"
          color="text.secondary"
        >
          {place.strInstructionsES}
        </MyTypography>
      </CardContent>

      <MyActions>
        <MyButton size="small" color="primary">
          Ver comentarios
        </MyButton>
      </MyActions>

    </MyCard>
  );
}

PlacesCard.propTypes = {
  place: PropTypes.shape([]).isRequired,
};
